    false,nt"url": null,nt"notes": "This annual narrative report for Charles
    M. Russell NWR; Hailstone, Halfbreed, Lake Mason, and War Horse National Wildlife
    Refuges; the CMR Wetland Management District outlines Refuge accomplishments during
    the 1995 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the master plan, management planning, public participation,
    compliance with environmental and cultural resource mandates, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, croplands, grasslands, grazing, haying, fire management,
    pest control, and wilderness areas. The wildlife section of the report discusses
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, fisheries resources, wildlife propagation, surplus animal
    disposal, scientific collections, animal control, marking and bird banding, and
    disease control. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, computer
    systems, and energy conservation. Items of interest are provided at the end. Refuge
    brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
